package youtubedlwrapper

import (
	"encoding/base64"
	"encoding/json"
	"os/exec"
	"testing"
)

func TestYoutubeDLWrapper_GetMetaData(t *testing.T) {
	t.Parallel()

	decodedBase64, err := base64.StdEncoding.DecodeString(testVideos[0].base64json)
	if err != nil {
		t.Errorf("testVideo (%v), could not decode base64 error (%v)\n", testVideos[0].name, err)
	}

	cmdMocker := commandMocker{
		stdinData:  "",
		stdoutData: string(decodedBase64),
		stderrData: "",
	}

	youtubeDLWrapper := Wrapper{wrapperOptions: WrapperOptions{
		YoutubeDLBinary: "",
		cmd:             cmdMocker.makeMockCommand,
	}}

	metadata, err := youtubeDLWrapper.GetVideoMetadata("https://www.youtube.com/watch?v=lfW5CF0Nsis")
	if err != nil {
		t.Error(err)
		return
	}

	if metadata.ID == "" {
		t.Error("Metadata doesnt exist after error isn't nil")
	}

	cmdMocker.runErr = &exec.ExitError{
		ProcessState: nil,
		Stderr:       []byte("status code 1"),
	}
	cmdMocker.stderrData = "status code 1"
	_, err = youtubeDLWrapper.GetVideoMetadata("https://www.youtube.com/watch?v=lfW5CF0NsiBADURL")
	if err != nil {
		return
	}

	t.Error("Did not receive an error from bad url passed to youtube-dl")
}

func Test_CheckValidTestVideos(t *testing.T) {
	for _, test := range testVideos {
		decodedBase64, err := base64.StdEncoding.DecodeString(test.base64json)
		if err != nil {
			t.Errorf("testVideo (%v), could not decode base64 error (%v)\n", test.name, err)
		}
		videoMetadata := VideoMetadata{}
		err = json.Unmarshal(decodedBase64, &videoMetadata)
		if err != nil {
			t.Errorf("testVideo (%v), could not unmarshal decodedBase64 into VideoMetadata, error (%v)\n", test.name, err)
		}

		//todo: check against test.videoMetadata
	}
}

type TestVideo struct {
	name          string
	base64json    string
	videoMetadata VideoMetadata
}

var testVideos = []*TestVideo{
	{
		name:          "lfW5CF0Nsis",
		base64json:    "",
		videoMetadata: VideoMetadata{},
	},
	{
		name:          "zzAdEt3xZ1M",
		base64json:    "",
		videoMetadata: VideoMetadata{},
	},
}
